import React, { Component } from 'react';
import logo from './paul.png';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <h4>Random Card Generator</h4>
        <div className="controls">
        </div>
      </div>
    );
  }
}

export default App;
